import { UserNameContext } from "./UsernameContext"

const { username } = useContext(UserNameContext)

const DataFromLocalStorage = () => {
    <ul>
                {JSON.parse(localStorage.getItem(username)).map((item) =>
        <li>
            {item}
        </li>
    )}
    </ul>
}

export default DataFromLocalStorage
